import React,{useState, useEffect} from 'react'
import axios from 'axios'
import { response } from 'express'


function Quote() {
    const [quote, setQuote] = useState('')

    useEffect(() => {
        axios.get('/api/quote')
        .then(response => {
            setQuote(response.data.quote)
        })
        .catch(error => {
            console.error(error)
        })
    },[]);
  return (
    <div>
        <h1>Random quote Generator</h1>
        <p>{quote}</p>
    </div>
  )
}

export default Quote
